import React from 'react'
import './statics/styles/ChatInput.scss'
import {
    Send,
    NavigateNext
} from '@material-ui/icons'

function ChatInput () {
    return (
        <div className='ChatInput'>
            <div>
                <NavigateNext
                    style={{ color: 'white', fontSize: 40 }}
                />
            </div>
            <input/>
            <div className='fab'>
                <Send
                    style={{ fontSize: 15 }}
                />
            </div>
        </div>
    )
}

export default ChatInput
